import {
	AppBar,
	Box,
	Button,
	Stack,
	TextField,
	Toolbar,
	Typography,
} from "@mui/material";
import React, { useEffect, useState } from "react";
import ImageCard from "../Components/ImageCard";

const Home = () => {
	const [breed, setBreed] = useState({});
	let arr = Object.keys(breed);

	const [list, setList] = useState(arr);
	console.log(list);

	useEffect(() => {
		fetch(`https://dog.ceo/api/breeds/list/all`)
			.then((res) => {
				let response = res.json();
				return response;
			})
			.then((data) => setBreed(data.message))
			.catch((e) => console.log(e));
	}, []);

	const searchBreed = (name) => {
		let newList = list.filter((breed) => breed === name);
		setList(newList);
	};

	return (
		<Box sx={{ flexGrow: 1 }}>
			<AppBar
				position="static"
				sx={{
					display: "flex",
					flexDirection: "row",
					backgroundColor: "blue",
				}}
			>
				<Toolbar
					sx={{
						flexGrow: 1,
						display: "flex",
						flexDirection: "row",
						alignItems: "center",
						justifyContent: "space-between",
					}}
				>
					<Typography
						variant="h6"
						sx={{ marginLeft: "40%" }}
						onChange={(e) => searchBreed(e.target.value)}
					>
						Dog Gallery
					</Typography>
					<Button
						sx={{
							color: "white",
							backgroundColor: "green",
						}}
						variant="contained"
					>
						Custom Search
					</Button>
				</Toolbar>
			</AppBar>

			<TextField
				size="small"
				placeholder="Type here to filter by brand"
				sx={{
					marginTop: "2%",
					width: "45%",
					marginLeft: "27%",
				}}
			/>
			<Stack direction="row" flexWrap="wrap" gap="25px" padding="3%">
				{list.map((breed) => (
					<ImageCard name={breed} />
				))}
			</Stack>
		</Box>
	);
};

export default Home;
